var footerImage = 'data:image/jpeg;base64,';


/*
	display image based on the id.
	if there is image src, set the width and height,
	if there is no image src, set width and height to 0 to save space
 */

function displayImage(id)
{
	var imageDisplay = {};
	var myImage = document.getElementById(id);
	var myWidth = myImage.width;
	if (myWidth == 0)
	{
		imageDisplay =
		{
			text: "",
			width: 0,
			height: 0
		}
	}
	else
	{
		imageDisplay =
		{
			image: myImage.src,
			width: 160,
			height: 120
		}
	}
	return imageDisplay;
}